import React from 'react'

function TableRow( [idx,{id,first_name,last_name,city,province}] ){
    return (
        <tr>
            <th scope="row">{idx}</th>
            <td>{first_name} {last_name}</td>
            <td>{city}, {province}</td>
        </tr>
    )
}

export default TableRow
